import "./CharacterData.css";
import ChartBar from "./ChartBar";
const Chart = (ChartData) => {
  return (
    <div className="chart">
      {ChartData.dataPoints.map((eachData) => (
        <ChartBar
          key={eachData.label}
          label={eachData.label}
          value={eachData.value}
          maxValue={null}
        />
      ))}
    </div>
  );
};

export default Chart;
